import React from 'react';
import '../About.css';

const About = () => {
  return (
    <section id="about" className="about">
      <h2>À propos de moi</h2>
      <p>Plongez dans l'univers de ma passion et de ma curiosité, où la technologie rencontre l'art et la cosmologie, esquissant le portrait d'une exploratrice infatigable du savoir et de l'innovation</p>
    </section>
  );
}

export default About;
